import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <div class="flex h-screen">
          <div class="m-auto">
            <input type="text" placeholder="Input your task" class="block mb-2 bg-gray-100 p-2 rounded-lg border-2 border-indigo-500 shadow-md focus:outline-none focus:border-indigo-600" />

            <button
              type="button"
              class="px-4 py-3 bg-blue-600 rounded-md text-white outline-none focus:ring-4 shadow-lg transform active:scale-x-75 transition-transform mx-5 flex"
            >
              <span class="ml-2">Input</span>
            </button>
          </div>
        </div>
      </header>
    </div>
  );
}

export default App;
